script: |
  super -f text -I q4409.spq | sort > q4409.out

inputs:
  - name: q4409.spq
    data: |
      SELECT DISTINCT + col1 AS col2 FROM tab1 (FORMAT parquet) WHERE + 88 / + - col1 + col2 + + col2 * + 93 IS NOT NULL;
  - name: tab1

outputs:
  - name: q4409.out
    data: |
      14
      47
      5
